import React from 'react';

const DataDisplayComponent = ({ dataArray }) => {
  return (
    <table>
      <thead>
        <tr>
          <th>Filename</th>
          <th>Headlines</th>
          <th>Sentiment</th>
          <th>Keywords</th>
          <th>Score</th>
          <th>Upload Date</th>
          <th>Domain Links</th>
        </tr>
      </thead>
      <tbody>
        {dataArray.map((item, index) => (
          <tr key={index}>
            <td>{item.filename}</td>
            <td>{item.headlines}</td>
            <td>{item.sentiment}</td>
            <td>{item.keywords.join(', ')}</td>
            <td>{item.score}</td>
            <td>{item.upload_date}</td>
            <td>
              {item.domain_links.map((link, linkIndex) => (
                <div key={linkIndex}><a href={link} target="_blank" rel="noopener noreferrer">{link}</a></div>
              ))}
            </td>
          </tr>
        ))}
      </tbody>
    </table>
  );
};

export default DataDisplayComponent;
